import React from "react";
import "./footer.css";
import Logo from "./pages/SyImg/Logo.png";
import { phoneIcon } from "@material-ui/core";

const Footerr = () => {
  return (
    <div className="footer">
      <img src={Logo} alt="logo" />
      <div>
        <ul>
          <li>
            <p className="felem" style={{ marginBottom: "5%" }}>
              Sy Makina olarak işlerimizi profesyonel olarak yapıyoruz,
              kaliteden asla taviz vermiyoruz.
            </p>
          </li>
          <li>
            <p className="felem">06374 Ostim Osb/Yenimahalle/Ankara</p>
          </li>
          <li>
            <phoneIcon></phoneIcon>
            <p className="felem">+903123857693</p>
          </li>
          <li>
            <p className="felem">info@symakina.com</p>
          </li>
        </ul>
      </div>
      <div className="felem2">
        © 2021 SY Makina . Tüm Hakları Saklıdır - All Rights Reserved
      </div>
    </div>
  );
};

export default Footerr;
